--This is an essential recording for any jazz enthusiast. 

These live recordings capture the classic John Coltrane Quartet at full strength in what would prove to be its last years of existence. The 1965 Half Note recordings, taken from late-night radio broadcasts and until now available only as inferior-quality bootlegs, have long had legendary status among afficionados -- especially the extended performance of &quot;One Down, One Up,&quot; regarded by many as one of Coltrane&amp;#039;s greatest record improvisations. Newly transferred from Coltrane&amp;#039;s personal master tapes, these remarkable performance can at last be heard with the fidelity they deserve.
